import React, { useState } from "react";
import { Popup } from "./popup";

export function Navbar(props) {
    // State to manage popup visibility
    const [isPopupVisible, setIsPopupVisible] = useState(false);

    const time = new Date();
    const showTime = new Intl.DateTimeFormat('en-US', { 
        hour: 'numeric', 
        minute: 'numeric', 
        hour12: true, 
        timeZone: 'America/Los_Angeles'
    }).format(time);
    const [formattedTime, period] = showTime.split(' ');

    return (
        <nav className="navbar">
            <a href="#home-section">
                <p>ND</p>
            </a>
            <div>
                <p className="time">Seattle, WA <span>{formattedTime}</span> {period} </p>

                {/* Button to toggle popup */}
                <button onClick={() => setIsPopupVisible(true)}>
                    <img src="../img/burger-menu-svgrepo-com.svg" alt="menu"/>
                </button>

                {/* Popup component */}
                <Popup trigger={isPopupVisible} setTrigger={setIsPopupVisible}>
                    <a href='/home'>
                        <h3>HOME</h3>
                    </a>
                    <a href='/projects'>
                        <h3>PROJECTS</h3>
                    </a>
                    <a href='/about'>
                        <h3>ABOUT</h3>
                    </a>
                    <a href='/contact'>
                        <h3>CONTACT</h3>
                    </a>
                    <a href='/resume'>
                        <h3>RESUME</h3>
                    </a>
                </Popup>
            </div>
        </nav>
    )
}
